import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import Login from './pages/Login'; // Ajusta la ruta según dónde lo guardaste
import Bienvenida from './pages/Bienvenida';
function Home() {
  return (
    <div style={{ padding: '20px' }}>
      {/* Barra superior */}
      <div style={{
        display: 'flex',
        justifyContent: 'space-between',
        alignItems: 'center'
      }}>
        <Link to="/contacto">
          <button style={{ background: '#a78Bfa', color: '#fff', margin: '0 10px' }}>Contáctanos</button>
        </Link>
        <div>
          <button style={{ background: '#7dd3fc', color: '#222', margin: '0 10px' }}>Logo</button>
        </div>
        <Link to="/login">
          <button style={{ background: '#a78Bfa', color: '#fff', margin: '0 10px' }}>Iniciar sesión</button>
        </Link>
      </div>

      {/* Área central tipo "hero" */}
      <div style={{
        margin: '40px auto',
        padding: '40px 0',
        background: '#7dd3fc',
        borderRadius: '15px',
        color: '#222',
        textAlign: 'center',
        maxWidth: 600,
        minHeight: 300
      }}>
        <h2>Información de la empresa</h2>
        <p>Aquí puedes poner texto corto, descripción y tus servicios principales.</p>
      </div>
    </div>
  );
}

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/login" element={<Login />} />
        <Route path='/Bienvenida' element={<Bienvenida />}/>
      </Routes>
    </Router>
  );
}

export default App;
